import React from "react";
import LargeButton from "./LargeButton";
import Title from "./Title";
import InputField from "./InputField";
import Footer from "./Footer";
import PhoneImage from "./PhoneImage";
import { Container, Row, Col } from "react-bootstrap";

class Home extends React.Component {
    constructor() {
        super();
        this.state = {

        }
        this.handleClickRegistration = this.handleClickRegistration.bind(this);
        this.handleClickLogIn = this.handleClickLogIn.bind(this);
    }
    handleClickRegistration() {

    }
    handleClickLogIn() {
    }

    render() {
        return (
            <Container fluid={true}>
                <Row>
                    <Col ></Col>
                    <Col md="auto">
                        <Title
                            fontSize="140px"
                            fontWeight="lighter"
                            color="#666666"
                            text="#TECH"
                        />
                    </Col>
                    <Col></Col>
                </Row>
                <Row>
                    <Col></Col>
                    <Col md="auto">
                        <Title
                            fontSize="40px"
                            fontWeight="lighter"
                            color="#b2b2b2"
                            text="New thinking. New #tech."
                        />
                    </Col>
                    <Col></Col>
                </Row>
                <Row>
                    <div style={{visibility:"hidden", fontSize:"30px"}}>d</div>
                </Row>
                <Row className="justify-content-md-center">
                    <Col style={{ backgroundColor: "red" }} lg={6} md={12}>
                        <PhoneImage style={{ width:"80%", marginLeft:"50px"}}/>
                    </Col>
                    <Col style={{backgroundColor: "yellow"}} lg={6} md={12}>
                            <Row>
                                <Col >
                                    <Row>
                                        <Title
                                            fontSize="50px"
                                            fontWeight="bold"
                                            color="#666666"
                                            text="W E L C O M E"
                                        />
                                    </Row>
                                    <Row>
                                        <InputField type="text" placeholder="Email" style={{marginTop:"10px",width:"450px", height:"50px"}} />
                                    </Row>
                                    <Row>
                                        <InputField type="password"  placeholder="Password" style={{marginTop: "20px", width:"450px", height:"50px"}} />
                                    </Row>
                                    <Row>
                                        <a href="" style={{marginTop:"10px"}}>New user? Register here.</a>
                                    </Row>
                                    <Row>
                                        <LargeButton
                                            value="LOG IN"
                                            style={{ 
                                                width:"200px",
                                                height:"50px",
                                                borderRadius:"10px",
                                                backgroundColor:"#2d2d2d",
                                                borderColor:"#2d2d2d", 
                                                fontSize:"20px",
                                                color:"white"}}
                                            handleClick={this.handleClickLogIn}
                                        />
                                    </Row>
                                </Col>
                            </Row>

                    </Col>
                </Row>
            </Container>
        );
    }


}

export default Home;
